import React from 'react';
import ReactDOM from 'react-dom/client';
import { ChakraProvider } from '@chakra-ui/react'; // ✅ chuẩn chỉnh
import App from './App';
import { defaultSystem } from "@chakra-ui/react"

const root = ReactDOM.createRoot(document.getElementById('root') as HTMLElement);
root.render(
    <React.StrictMode>
        <ChakraProvider value={defaultSystem}>  {/* Không cần theme nếu không custom */}
            <App />
        </ChakraProvider>
    </React.StrictMode>
);
